// src/components/ModelSelector.js
import React, { useState } from 'react';

const ModelSelector = ({ selectedDevice, onSelectModel }) => {
  const [selectedModel, setSelectedModel] = useState('');

  const handleModelChange = (model) => {
    setSelectedModel(model);
    onSelectModel(model);
  };

  return (
    <div>
      <h2>Select Model for {selectedDevice}:</h2>
      {/* Display models based on selected device */}
      {/* Add your model options here */}
      <ul>
        <li onClick={() => handleModelChange('Model 1')}>Model 1</li>
        <li onClick={() => handleModelChange('Model 2')}>Model 2</li>
        {/* Add more models as needed */}
      </ul>
    </div>
  );
};

export default ModelSelector;
